import{b as d,e as g,f as t,F as o,r as e,o as i,h as m}from"./entry.aa288e20.js";import{P as n}from"./Popup.48dd1ee4.js";import{F as p}from"./Form.2d181227.js";import{C as r}from"./Categories.cdadbc19.js";import{C as l}from"./CatalogItems.6c7bf4fe.js";import"./nuxt-img.3721d2d1.js";/* empty css                  */import"./nuxt-link.a4197a64.js";import"./grid.min.82f75050.js";import"./thumbs.min.284b391e.js";/* empty css                       */import"./grid.123b854c.js";const j={class:"catalog container"},b=t("h1",{class:"catalog-title"},[t("span",null,"Шкафы в современном исполнении ")],-1),h={class:"catalog-categories"},P=t("h2",{class:"catalog-title"},[t("span",null,"Смотреть все Шкафы")],-1),w={class:"catalog-items"},I={components:{Popup:n,Form:p,Categories:r,CatalogItems:l},data(){return{isVisible:!1}},methods:{closePopup(){this.isVisible=!1}}},E=Object.assign(I,{__name:"index",setup(y){d({title:"Royal-Wood | Шкафы на заказ в Москве | Изготовление кухонной мебели по размерам под заказ"});const s=[{title:"Шкафы в современном исполнении",categoryLink:"modern",categoryPath:"/catalog/wardrobes/",img:"modern-title.jpg"},{title:"Шкафы в классическом исполнении",categoryLink:"classic",categoryPath:"/catalog/wardrobes/",img:"classic-title.jpg"}],c=[{title:"Встроенный белый шкаф скрытого типа",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, ручки из латуни, внутренняя подсветка.",description:"Вместительный встроенный шкаф в холле, замаскированный под стеновые панели, точно решит все вопросы с хранением, существенно сэкономит пространство, при этом украшая интерьер. ",img:"item-slide-1-3.jpg",catalogLink:"item-1",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-slide-1-3.jpg",img2:"item-slide-1-1.jpg",img3:"item-slide-1-2.jpg",img4:"item-1.jpg"}},{title:"Шкаф для прихожей из МДФ",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, подсветка.",description:"Идеальный шкаф для входной зоны, совмещающий гардеробную и отделения под хозяйственные нужды. Фасады выполнены в цвет стен. Функциональное наполнение разработано специально под запросы заказчика. Дополняет удобство и функциональность помещения дверь с зеркалом в полный рост.",img:"item-2.jpg",catalogLink:"item-2",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-2.jpg",img2:"item-slide-2-1.jpg",img3:"item-slide-2-2.jpg",img4:"item-slide-2-3.jpg"}},{title:"Белый шкаф для спальни из МДФ",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, винтажные зеркала.",description:"Шкаф для женской спальни. Фасады декорированы состаренными зеркалами, благодаря чему пространство кажется более обьемным и живым, оставаясь элегантным и загадочным.",img:"item-3.jpg",catalogLink:"item-3",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-3.jpg",img2:"item-slide-3-1.jpg",img3:"item-slide-3-2.jpg",img4:"item-slide-3-3.jpg",img5:"item-slide-3-4.jpg",img6:"item-slide-3-5.jpg"}},{title:"Встроенный шкаф из шпона дуба",materials:"<strong>Материалы и отделка:</strong> мдф, шпон дуба",description:"Так выглядит применение дуба в современном интерьере. Для отделки стеновой панели и примыкающего к ней встроенного шкафа мы использовали натуральный шпон дуба. И стена, и шкаф выглядят как единый декоративный акцент в этой гостиной.",img:"item-4.jpg",catalogLink:"item-4",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-4.jpg",img2:"item-slide-4-1.jpg",img3:"item-slide-4-2.jpg"}},{title:"Шкаф с рифленым стеклом, покрытый эмалью нежного оттенка",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, внутренняя подсветка.",description:"Очень красивая и функциональная система хранения, расположенная в лоджии. Модным трендом в последнее время стали предметы мебели с рифлеными поверхностями. Такая фактура одинаково хорошо смотрится как в современном, так и в классическом интерьере. Рифленое стекло занимает одну из топовых позиций  среди способов декоративной отделки.",img:"item-5.jpg",catalogLink:"item-5",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-5.jpg",img2:"item-slide-5-1.jpg",img3:"item-slide-5-2.jpg"}},{title:"Шкаф из шпона дуба с подсветкой",materials:"<strong>Материалы и отделка:</strong> мдф, шпон дуба, подсветка.",description:"Шкаф для комнаты взрослого ребенка, в котором учтен весь необходимый функционал, и использованы нужные материалы. Предусмотрено хранение одежды и личных вещей, встроена декоративная подсветка полок, спокойная расцветка натурального дерева и современный дизайн отлично дополняют интерьер.",img:"item-slide-6-3.jpg",catalogLink:"item-6",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-slide-6-3.jpg",img2:"item-slide-6-5.jpg",img3:"item-slide-6-4.jpg",img4:"item-slide-6-1.jpg",img5:"item-6.jpg",img6:"item-slide-6-2.jpg"}},{title:"Симметричные шкафы премиум-класса с отделкой латунью",materials:"<strong>Материалы и отделка:</strong> мдф, матовая эмаль, сатинированная латунь.",description:"Симметричные шкафы  для современной  детской комнаты создают ощущение размеренности и организованного пространства. Сочетание белой матовой эмали и декора из сатинированной латуни в мягко-золотистом оттенке смотрится эффектно, безупречно и стильно.",img:"item-7.jpg",catalogLink:"item-7",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-7.jpg",img2:"item-slide-7-1.jpg",img3:"item-slide-7-2.jpg"}},{title:"Эксклюзивный встроенный шкаф скрытого типа с латунными вставками",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, латунь, внутренняя подсветка.",description:"Функциональное решение для хранения реализовано по проекту дизайнера в гостиной. Вместительный встроенный шкаф, замаскированный под декоративную стеновую панель, со вставками из латуни. Белый цвет эмали и теплый блеск благородного металла прекрасно гармонируют и притягивают внимание. Распашные створки небольшой ширины делают удобным доступ к содержимому.",img:"item-8.jpg",catalogLink:"item-8",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-8.jpg",img2:"item-slide-8-1.jpg",img3:"item-slide-8-2.jpg",img4:"item-slide-8-3.jpg"}},{title:"Дизайнерский шкаф для прихожей с открытой секцией из шпона ореха",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, латунь, шпон ореха.",description:"Стильные и современные шкафы для зоны прихожей, украшенные ручками из латуни, с контрастной секцией открытых полок из ореха, являются частью большого проекта квартиры. Удивительно гармонично подобраны дизайнером все сочетания материалов, форм  и декора, представляя перед нами единство стиля и  лоска, при этом комфорта и уюта. Подробнее Вы можете увидеть в разделе <a href='/projects' >Наши проекты.</a>  ",img:"item-9.jpg",catalogLink:"item-9",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-9.jpg",img2:"item-slide-9-1.jpg"}},{title:"Белый элитный шкаф для спальни с матовыми зеркалами",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, матовое зеркало сатинато, встроенная подсветка.",description:"Эффектный дизайнерский шкаф для спальни с тремя створками и  матовыми зеркалами на фасадах. Воздушный, яркий, как будто даже сам нарядный и праздничный, обрамленный кружевом лепнины на потолке.",img:"item-10.jpg",catalogLink:"item-10",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-10.jpg",img2:"item-slide-10-1.jpg",img3:"item-slide-10-2.jpg"}},{title:"Шкаф-стеллаж для гостиной из шпона американского ореха",materials:"<strong>Материалы и отделка:</strong> мдф, шпон ореха, ручки из латуни.",description:"Открытая система хранения из ореха. По запросу заказчика здесь будет располагаться уголок меломана, то есть музыкальная техника, проигрыватель и внушительная коллекция пластинок и музыкальной литературы. Простые формы, функциональность и благородный материал – разве такое сочетание может не вдохновлять?! Этот шкаф из американского ореха с уникальной фактурой дерева выглядит изысканно и достойно.",img:"item-11.jpg",catalogLink:"item-11",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-11.jpg",img2:"item-slide-11-1.jpg",img3:"item-slide-11-2.jpg",img4:"item-slide-11-3.jpg"}},{title:"Библиотека с ажурными зеркальными фасадами, покрытая белой эмалью",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Библиотека для небольшой гостиной с камином в московском пентхаусе состоит из двух симметричных шкафов с открытыми и закрытыми секциями. Переплетение зеркал и ажурной раскладки на фасадах  создает элегантный и утонченный образ интерьера",img:"item-12.jpg",catalogLink:"item-11",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-12.jpg",img2:"item-slide-12-1.jpg",img3:"item-slide-12-2.jpg",img4:"item-slide-12-3.jpg",img5:"item-slide-12-4.jpg",img6:"item-slide-12-5.jpg"}},{title:"Распашные шкафы для прихожей по индивидуальному проекту",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Шкафы в современном стиле для зоны прихожей. Часть фасадов декорирована рифлеными поверхностями в виде вертикальных реек. Ручки интегрированны непосредственно в дверцы. Без накладных ручек мебель выглядит современно и лаконично, взгляд не цепляется за лишние детали, а дети не цепляются за выступающие ручки. Сегодня это тренд на функциональность. Поэтому ручки здесь представляют собой фрезерованные вертикальные выемки на фасадах, выкрашенные в цвет шкафа.",img:"item-13.jpg",catalogLink:"item-13",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-13.jpg",img2:"item-slide-13-1.jpg"}},{title:"Элитный шкаф в спальню в современном стиле",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Лаконичный шкаф для спальни с геометрическим рисунком фрезеровки и квадратными ручками. Встраиваемый шкаф – идеальный вариант для хранения. Он не имеет собственного каркаса, обустраивается только внутреннее наполнение и распашные или раздвижные створки. Это позволяет сэкономить на его стоимости за счет меньшего обьема материала.",img:"item-14.jpg",catalogLink:"item-14",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-14.jpg",img2:"item-slide-14-1.jpg"}},{title:"Шкаф премиум класса для прихожей",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Шкаф  под потолок для хранения в прихожей с декоративными молдингами и ручками из полудрагоценного агата. Так сегодня выглядит современная роскошь – минимализм, комфорт и дорогие детали.",img:"item-15.jpg",catalogLink:"item-15",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-15.jpg",img2:"item-slide-15-1.jpg"}},{title:"Белый глянцевый шкаф с внутренней отделкой шпоном ореха",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, глянцевый лак, шпон ореха, внутренняя подсветка",description:"Оригинальный шкаф для спальни пропитан современным духом от фасада до внутренних стенок. Лаконичный дизайн решили усилить с помощью двухцветного образа, сочетая белый глянец снаружи и цвет ореха внутри. ",img:"item-16.jpg",catalogLink:"item-16",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-16.jpg",img2:"item-slide-16-1.jpg",img3:"item-slide-16-2.jpg"}},{title:"Элегантный светлый шкаф с радиусными филенками",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Топовый по популярности как у дизайнеров, так и у наших заказчиков шкаф с радиусными филенками. Относится скорее к современной классике, но одинаково прекрасно вписывается и в тот, и в другой стиль. По своему назначению шкаф тоже универсальный, может гармонично разместиться и в прихожей, и в спальне, и в гостиной, и в детской комнате, словно подстраиваясь под Ваш интерьер.",img:"item-17.jpg",catalogLink:"item-17",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-17.jpg",img2:"item-slide-17-1.jpg",img3:"item-slide-17-2.jpg"}},{title:"Стильный глянцевый шкаф с зеркалами",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, глянцевый лак",description:"Стильный шкаф в прихожей был идеально спроектирован и прекрасно вписался в нестандартную нишу. Строгий и элегантный за счет глянцевой отделки и зеркальных фасадов, этот шкаф не оставит равнодушным тех, кто ценит гармонию и геометричность.",img:"item-18.jpg",catalogLink:"item-18",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-18.jpg",img2:"item-slide-18-1.jpg"}},{title:"Премиальный шкаф для переговорной по индивидуальному проекту",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, подсветка",description:"Премиальный шкаф для переговорной в частном ателье с меняющимся обликом за счет раздвижных дверей. Их положение можно менять по Вашему усмотрению, оставляя открытыми либо центральную часть, либо крайние секции. Соединив двери в центральном положении, мы увидим восьмиконечную звезду – знак, помогающий, сосредоточиться на своих целях, раскрыть свой творческий потенциал и держать свои дела и мысли под контролем. Представительный и завораживающий шкаф словно демонстрирует мощную энергию и уверенность владельца.",img:"item-19.jpg",catalogLink:"item-19",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-19.jpg",img2:"item-slide-19-1.jpg",img3:"item-slide-19-2.jpg"}},{title:"Шкаф, покрытый белой эмалью с зеркальными фасадами и деревянной раскладкой",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Элитный шкаф, покрытый белой эмалью из МДФ. Зеркальные фасады украшены деревянными накладками в виде геометрических узоров. Благодаря некоторым классическим элементам декора, таким как карниз и филенки в нижней части дверных створок, этот шкаф можно отнести к стилю современная классика.",img:"item-20.jpg",catalogLink:"item-20",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-20.jpg",img2:"item-slide-20-1.jpg"}},{title:"Глянцевый белоснежный шкаф с 3D фасадами",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, глянцевый лак, подсветка.",description:"Глянцевый белоснежный шкаф с 3D фасадами подойдет для гламурного и динамичного интерьера. Ящики обтянуты замшей, ручки из белой кожи – этот шкаф одинаково эффектный и люксовый как снаружи, так и внутри, для истинных ценителей стиля арт-деко. За счет использования всей высоты помещения мы добились максимальной вместительности, обеспечив порядок и комфорт.",img:"item-21.jpg",catalogLink:"item-21",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-21.jpg",img2:"item-slide-21-1.jpg",img3:"item-slide-21-2.jpg",img4:"item-slide-21-3.jpg"}},{title:"Премиальный шкаф из массива с внутренней отделкой белой кожей",materials:"<strong>Материалы и отделка:</strong> массив дуба, матовая  эмаль, кожа, подсветка",description:"Премиальный шкаф из массива в стиле Ральф Лорен. Чистые линии, природные материалы, благородные цвета – вот наши отправные точки при создании этого роскошного предмета мебели. Внутри шкаф обтянут белой кожей, предусмотрена красивая подсветка для смены сценариев освещения в комнате. Он, как настоящий бриллиант, подчеркнет состоятельность и безупречное чувство стиля своего владельца.",img:"item-slide-22-1.jpg",catalogLink:"item-22",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-slide-22-1.jpg",img2:"item-22.jpg"}},{title:"Шкаф-стеллаж для гостиной из экзотического шпона макасар",materials:"<strong>Материалы и отделка:</strong> мдф, шпон макасара.",description:"Шкаф-стеллаж в гостиной из экзотического макасара. Если Вы мечтаете уйти от монотонности в интерьере, а также создать ощущение солидности и респектабельности, то использование уникального материала – лучшее решение.",img:"item-23.jpg",catalogLink:"item-23",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-23.jpg"}},{title:"Шкаф премиум-класса из массива дуба",materials:"<strong>Материалы и отделка:</strong> массив дуба, тонировка, подсветка.",description:"Шкаф премиум -класса из массива дуба для зоны ТВ в гостиной оценят истинные любители роскошных и эксклюзивных интерьеров. Модель с открытыми полками, а также глухими нижними секциями подойдёт также для библиотеки или кабинета. Дерево, тонированное в благородный темный оттенок, в качестве изящного украшения использован резной декор. Восхищение и восторг с первого взгляда! ",img:"item-24.jpg",catalogLink:"item-24",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-24.jpg"}},{title:"Встроенные шкафы для спальни из черного глянца с затемненным стеклом",materials:"<strong>Материалы и отделка:</strong> мдф, глянцевая эмаль, затемненное стекло, подсветка, натуральный шпон ореха",description:"Симметричные шкафы для аппартаментов в Москва Сити, интегрированные в стеновую панель  с открытыми полками. Контрастное сочетание черного глянца, темного стекла и шпона дерева, плюс лаконичная подсветка – такая комбинация ключ к стильному, представительному, ультрасовременному интерьеру. Отказавшись от шкафов во всю стену  в пользу данной конструкции, мы добавили немного воздуха, простора и легкости помещению.",img:"item-25.jpg",catalogLink:"item-25",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-25.jpg",img2:"item-slide-25-1.jpg",img3:"item-slide-25-2.jpg"}},{title:"Индивидуальный шкаф-стеллаж для домашнего спортзала, покрытый матовой эмалью",materials:"<strong>Материалы и отделка:</strong> мдф, матовая эмаль, подсветка",description:"Стеллаж, выполненный по индивидуальным размерам, для домашнего спортзала. Удобная организация пространства для хранения с отрктытыми полками и закрытыми секциями.",img:"item-26.jpg",catalogLink:"item-26",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-26.jpg"}},{title:"Стильный встроенный шкаф под глянцевой эмалью и с затемненным стеклом",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, глянцевый лак, затемненное стекло.",description:"Шкаф со стеклянными фасадами и тонким металлическим профилем, в сочетании с черным гляцневым покрытием дверок можно считать идеальным примером современной лаконичности.Конструкция шкафа, идеально встроенная в нишу, экономит пространство и придает особый тон помещению.",img:"item-27.jpg",catalogLink:"item-27",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-27.jpg"}},{title:"Дизайнерский шкаф кремового оттенка с радуисными филенками",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Элитный дизайнерский шкаф по индивидуальному проекту с трендовыми радиусными филенками на фасадах. Продумано все от современного функционального наполнения до изысканной фурнитуры. Благородный кремовый оттенок эмали и зеркала на фасадах наполняют комнату светом и уютом. Кстати, внешний вид дверок шкафа полностью идентичен по дизайну с межкомнатными дверьми в этом проекте.",img:"item-28.jpg",catalogLink:"item-28",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-28.jpg",img2:"item-slide-28-1.jpg",img3:"item-slide-28-2.jpg",img4:"item-slide-28-3.jpg"}},{title:"Современный шкаф с классическими элементами",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, золотая поталь.",description:"Современный шкаф с классическими элементами в виде высокого профильного карниза и  изящного золотистого декора. Деревянная раскладка на зеркальных фасадах повторяет дизайн межкомнатных дверей. К слову, кухонный гарнитур в этом проекте выполнен в таком же стиле (его можно посмотреть в разделе Современные кухни), таким образом, мы создали единый элегантный и гармоничный образ дома, когда пространство как бы перетекает из одного в другое.",img:"item-29.jpg",catalogLink:"item-29",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-29.jpg",img2:"item-slide-29-1.jpg",img3:"item-slide-29-2.jpg"}},{title:"Элитный шкаф по эскизу дизайнера с декоративной раскладкой на зеркальных фасадах",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Элитный шкаф, изготовленный по эскизу дизайнера, с декоративной ажурной раскладкой на зеркалах. В условиях небольшой площади он по всем законам расширяет и увеличивает визуально пространство, делает его светлее и воздушнее. А в более крупном формате такой шкаф  просто способен радикально преобразить интерьер, от него просто невозможно отвести взгляд. Обратите внимание на ракурс крупным планом: идеальная подгонка деталей, аккуратная обработка. Даже на однотонной мебели белого цвета вы не найдете недочетов. Именно благодаря высочайшему качеству изделий, наша мебель относится к премиум сегменту. ",img:"item-30.jpg",catalogLink:"item-30",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-30.jpg",img2:"item-slide-30-1.jpg",img3:"item-slide-30-2.jpg",img4:"item-slide-30-3.jpg",img5:"item-slide-30-4.jpg"}},{title:"Шкаф для прихожей под матовой эмалью с фурнитурой из латуни",materials:"<strong>Материалы и отделка:</strong> мдф,  матовая эмаль",description:"Для решительных хозяев, предпочитающих быть в центре внимания во всем, и даже в интерьере, мы изготовили яркий неординарный шкаф для прихожей, покоряющий своей индивидуальностью и при этом выполняющий все свои функции. Стена  с вешалками для верхней одежды декорирована рифленой панелью,  зеркальные фасады очень уместны в прихожей, и даже удалось пристроить небольшую мягкую скамейку – все пожелания заказчиков были учтены. Украсили шкаф модной фурнитурой из латуни.",img:"item-31.jpg",catalogLink:"item-31",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-31.jpg"}},{title:"Шкаф для детской комнаты по индивидуальному заказу",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Шкаф для детской, изготовленный по индивидуальному заказу. В чем преимущество мебели на заказ? <br/> <ul><li>Ящики, полки, высоты элементов – все проектировалось с учетом индивидуальных пожеланий заказчика.</li><br/><li>Даже штанги для одежды спроектированы с учетом роста и типа одежды сына заказчиков.</li><br/><li>Рядом со шкафом – приставная лесенка, чтобы ребенок смог дотянуться до высоких секций.</li><br/><li>Так как ребенок увлекается сборкой моделей Лего, под потолком дизайнер спроектировал галерею из открытых полок с подсветкой. Там будут размещены крупные и красивые модели, которые он не использует для повседневных игр.</li><br/><li>Второе увлечение – бластеры. Открытые полки сделаны и для них. Задняя стенка шкафа выполнена с перфорацией, в которую вставляются переставные штыри. На них можно разместить игрушку любого размера.</li> <br/><li>Крайняя левая секция шкафа сделана на колесиках, так как прикрывает инженерный люк. Доступ к нему может потребоваться раз в 10 лет, а может и не потребоваться вовсе, но доступ в любом случае обеспечен.</li></ul><br/> Из таких нюансов складывается приятное ощущение, что это не просто шкаф с картинки, а именно ВАШ шкаф, в Вашем доме.",img:"item-32.jpg",catalogLink:"item-32",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-32.jpg"}},{title:"Шкаф для детской по проекту дизайнера с рабочим местом",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Дизайнерский шкаф для детской со встроенным рабочим местом. Шкаф – не только комфортное место для хранения ваших вещей, но и ключевой элемент интерьера, наполняющий пространство особым настроением.  Совершенство линий и форм, проработанные дизайнерами и проектировщиками, придадут прихожей, спальне или гардеробной гармонию и завершенность, преобразит пространство, придаст неповторимый шарм интерьеру в стиле арт-деко. Ажурная раскладка на зеркалах добавит нотку романтизма и мечтательности.Размеры, материалы и цвет можно подобрать под Ваши индивидуальные запросы.",img:"item-slide-33-3.jpg",catalogLink:"item-33",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-slide-33-3.jpg",img2:"item-slide-33-1.jpg",img3:"item-slide-33-2.jpg",img4:"item-33.jpg"}},{title:"Шкаф-библиотека с приставной лестницей из массива дуба",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, приставная лестница – массив дуба",description:"Дизайнерский шкаф-библиотека. Изначально это был балкон при кухне, пока дизайнер с заказчиком не решили его присоединить, разместив небольшую уютную библиотеку и зону для чтения.",img:"item-34.jpg",catalogLink:"item-34",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-34.jpg",img2:"item-slide-34-1.jpg",img3:"item-slide-34-2.jpg"}},{title:"Встроенный в нишу шкаф  со стеклянными полками и подсветкой",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль,шпон ореха",description:"Задекорировали нишу, разместив в ней шкафчик со стеклянными полками и подсветкой. Задняя стенка выполнена из шпона ореха. Имеется также закрытая секция с дверцей, так что функционально можно использовать не только для декора, но и для хранения. Конструкция легкая и воздушная, но , согласитесь, такие элементы вносят в обстановку элегантность, изысканность и  нотку аристократизма.",img:"item-35.jpg",catalogLink:"item-35",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-35.jpg",img2:"item-slide-35-1.jpg",img3:"item-slide-35-2.jpg"}},{title:"Книжный шкаф из МДФ",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"“Чтение хороших книг – это разговор с лучшими людьми прошедших времен, и притом такой разговор, когда они сообщают нам лучшие свои мысли”.<br/><br/> <span style='right: 40px;position: absolute;'>Рене Декарт</span>  <br/><br/> Мы производим книжные шкафы и мебель для домашней библиотеки по Вашему проекту, поэтому не отказывайте себе в удовольствии удобно устроиться с любимой книгой в уютном уголке Вашего дома. Уголок для чтения можно обустроить даже в самой маленькой квартире. Все, что для этого нужно: удобное кресло, хорошее освещение и место для хранения книг от Royal Wood.",img:"item-36.jpg",catalogLink:"item-36",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-36.jpg",img2:"item-slide-36-1.jpg",img3:"item-slide-36-2.jpg"}},{title:"Шкаф для прихожей с зеркальными фасадами",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, встроенная подсветка",description:"Удачное использование зеркал в солнечной прихожей на фасадах эксклюзивного шкафа от нашей столярной мастерской. Эстетика в каждой детали. Даже выдвижные полки для обуви имеют свой дизайн. <br/><br/> Базовая комплектация шкафа обычно оснащается по минимуму – это стационарные полки, выдвижные ящики и продольные штанги для вешалок. Но чтобы использовать весь потенциал конструкции, мы предлагаем большой ассортимент функциональных элементов наполнения под любые потребности. Наиболее популярные из них: <br/><br/> <ul><li>- Пантограф (мебельный лифт)</li><br/><li> - Сетчатые корзины</li><br/><li>- Бельевые корзины (с тканевым мешком)</li><li>вешало поперечные (применяются в узких конструкциях)</li><br/><li>- Держатели для брюк выдвижные</li><br/><li>- Выдвижные ящики с ячейками для аксессуаров, украшений и белья</li><br/><li>- Каскадные обувницы</li><br/><li>- Встроенная гладильная доска</li><br/><li>- Изготовим на заказ любые держатели или корзины для бытовой техники, предметов хобби, игрушек, коллекций аксессуаров</li></ul>",img:"item-37.jpg",catalogLink:"item-37",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-37.jpg",img2:"item-slide-37-1.jpg",img3:"item-slide-37-2.jpg",img4:"item-slide-37-3.jpg",img5:"item-slide-37-4.jpg"}},{title:"Эксклюзивный шкаф с зеркальными фасадами и отделкой в стиле 3D",materials:"<strong>Материалы и отделка:</strong> корпус - мдф,  крашенный под эмаль, фасады зеркало Оптивайт, квадраты – мдф, поталь.",description:"Эксклюзивный шкаф по индивидуальному проекту с зеркальными фасадами и эффектной отделкой в стиле 3D Diamond. Заказав у нас проект, Вы получите гарантии: <br/><br/> <ul><li>- Надежная конструкция и фурнитура</li><br/><li>- Запоминающийся дизайн</li><br/><li>- Использование современных технологий</li><br/><li>- Внутреннее наполнение по Вашим пожеланиям</li></ul>",img:"item-38.jpg",catalogLink:"item-38",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-38.jpg",img2:"item-slide-38-1.jpg",img3:"item-slide-38-2.jpg",img4:"item-slide-38-3.jpg"}},{title:"Встроенный шкаф-купе для прихожей",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Зона прихожей и небольшой встроенный в нишу шкаф-купе. Фацетные зеркала на фасадах  визуально расширяют пространство, наполняют дополнительным светом, делают его более обьемным, привлекают внимание.",img:"item-39.jpg",catalogLink:"item-39",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-39.jpg",img2:"item-slide-39-1.jpg",img3:"item-slide-39-2.jpg"}},{title:"Шкафы и остров для интерьера  московского бутика",materials:"<strong>Материалы и отделка:</strong> массив ольхи, мдф, эмаль.",description:"Шкафы и остров для бутика Saint Cashmere в Москве. У нас можно заказать оформление интерьера, шкафы, витрины, прилавки и другое торговое оборудование для Вашего бутика с индивидуальным дизайном. Это гарантированно позволит повысить эффективность Вашего бизнеса, вывести его на качественно новый уровень, сделать Ваш магазин солидным, успешным и узнаваемым.",img:"item-40.jpg",catalogLink:"item-40",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-40.jpg",img2:"item-slide-40-1.jpg",img3:"item-slide-40-2.jpg"}},{title:"Элитный шкаф для гостиной со стеклянными витринами",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Элитный шкаф для гостиной со стеклянными витринами и ТВ зоной презентует уверенность и стабильность. При своих внушительных габаритах смотрится легко и элегантно за счет стеклянных фасадов, не нарушая общей гармонии дома. <br/><br/>Для создания Вашего идеального интерьера мы предоставляем возможность выбрать цвет, материал и размер, исходя из конкретного проекта.",img:"item-41.jpg",catalogLink:"item-41",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-41.jpg"}},{title:"Встроенный шкаф для спальни с ТВ зоной",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Встроенный шкаф для спальни с ТВ зоной с оригинальным фрезерованным узором на карнизе и фасадах. Фрезеровка фасадов- это контурный рисунок на его лицевой стороне любой сложности и размера, любого расположения и направления. В процессе фрезеровки МДФ плиту  обрабатывают на специальном станке. Мебель с геометрической фрезеровкой – настоящий тренд. Фрезерованные фасады легко превращают типовую мебель в дизайнерскую.",img:"item-42.jpg",catalogLink:"item-42",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-42.jpg"}},{title:"Белый премиальный шкаф для прихожей с геометрической фрезеровкой фасадов",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Белый премиальный шкаф для прихожей с геометрической фрезеровкой фасадов покорит любого своим сдержанным и модным дизайном, идеальной строгостью линий и четкостью. Белоснежный оттенок сделает дом чище и опрятнее визуально.",img:"item-43.jpg",catalogLink:"item-43",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-43.jpg",img2:"item-slide-43-1.jpg"}},{title:"Эксклюзивный белоснежный шкаф по эскизу дизайнера",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Белоснежый шкаф премиум класса по эскизу дизайнера с эксклюзивно декорированными фасадами. Для создания идеального интерьера заказчику предоставляется возможность выбрать цвет, материал и размер, исходя из конкретного проекта.",img:"item-44.jpg",catalogLink:"item-44",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-44.jpg",img2:"item-slide-44-1.jpg"}},{title:"Элитный шкаф под белую матовую эмаль с контрастным обрамлением в цвете графит",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Элитный шкаф под белую матовую эмаль с контрастным обрамлением в цвете графит. Напоминаем, что стоимость мебели зависит от размеров, наполнения и сложности элементов. Для более точного просчета направляйте нам свои запросы на почту или по форме обратной связи.",img:"item-45.jpg",catalogLink:"item-45",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-45.jpg",img2:"item-slide-45-1.jpg"}},{title:"Шкаф для прихожей с зеркальными распашными  фасадами",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Шкаф для прихожей с зеркальными распашными  фасадами. Отлично подойдет для узкого помещения, делая его просторнее и светлее. Благородный дизайн скромно подчеркивает элегантность и строгость, гармонично сочетаясь с интерьером.<br/><br/>По желанию Вы можете выбрать материал, нужный размер и цвет, чтобы поддержать выбранную стилистику помещения.",img:"item-46.jpg",catalogLink:"item-46",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-46.jpg"}},{title:"Эксклюзивный шкаф для прихожей в стиле арт-деко с раздвижными дверями из шпона африканского макасара ",materials:"<strong>Материалы и отделка:</strong> шпон макасара, мдф, матовая эмаль, внутренняя подсветка",description:"Эксклюзивный шкаф для прихожей в стиле арт-деко с раздвижными дверями из шпона африканского макасара с ручным подбором по всем поверхностям фасадов, что создает непрерывность уникального рисунка. Обрамление в цвете темной матовой эмали отражает вулканическую силу и уверенность. Дизайн фасадов с обьемным 3D эффектом превратят любой комплект мебели в арт-обьект. Представительный и завораживающий, воплощающий в себе дух лидерства шкаф подчеркнет стремление владельца к первенству во всем.",img:"item-47.jpg",catalogLink:"item-47",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-47.jpg"}},{title:"Современный распашной шкаф из МДФ",materials:"<strong>Материалы и отделка:</strong> мдф, эамль.",description:"Современный распашной шкаф под потолок изготовлен по индивидуальным размерам, что гарантирует его установку с минимальными зазорами. Четкие геометричные формы создают баланс простора и функциональности в интерьере. Мебельный гарнитур дополнен встроенным туалетным столиком с зеркалом и подсветкой.",img:"item-48.jpg",catalogLink:"item-48",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-48.jpg",img2:"item-slide-48-1.jpg"}},{title:"Лаконичный шкаф премиум-класса с эксклюзивными латунными ручками",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, латунь.",description:"Шкаф класса премиум с эксклюзивными латунными ручками. Лаконичность, четкие формы  и высочайшее качество исполнения делает шкаф универсальным, ненавязчивым, но элегантным.",img:"item-49.jpg",catalogLink:"item-49",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-49.jpg",img2:"item-slide-49-1.jpg"}},{title:"Корпусный распашной шкаф под эмаль в  спокойном холодном оттенке",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Корпусный распашной шкаф под эмаль в  спокойном холодном оттенке. Здесь продумана каждая деталь – ровные линии, лаконичный дизайн, матовая финишная отделка. Такой образ говорит сам за себя, не нуждаясь в дополнительных деталях. Выбор за Вами – материал, цвет, фурнитура и размер под конкретный проект заказчика.",img:"item-50.jpg",catalogLink:"item-50",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-50.jpg",img2:"item-slide-50-1.jpg",img3:"item-slide-50-2.jpg"}},{title:"Шкаф для переговорной в современном офисе",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, латунь.",description:"Шкаф для переговорной в современном и уютном офисе с деталями фурнитуры из латуни и подсветкой. Совершенный, изысканный и практичный, для успешных и респектабельных владельцев. Размеры, цветовое решение  и материалы подбираются индивидуально под конкретный проект",img:"item-51.jpg",catalogLink:"item-51",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-51.jpg"}},{title:"Шкаф из массива и шпона дуба  с подсветкой и фрезерованными фасадами",materials:"<strong>Материалы и отделка:</strong> массив и шпон дуба.",description:"Фото не передает реальные размеры шкафа длиной 4,5 метра и высотой 3, 2 метра. Натуральные материалы и отсутствие лишнего декора гармонично вписываются в современный интерьер. Шкаф привлекает свои стильным и урбанистическим дизайном, наполняя комнату теплотой натурального дерева и являясь образцом прочности и экологичности.",img:"item-52.jpg",catalogLink:"item-52",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-52.jpg",img2:"item-slide-52-1.jpg"}},{title:"Встроенный шкаф со скрытой фурнитурой в стиле минимализм",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Образец в стиле минимализм с четкими лаконичными формами – просто, но со вкусом. Шкаф со скрытой фурнитурой встроенный в нишу, экономит пространство, подходит для тех кто ищет баланс простора и функциональности в своем интерьере, ценит сдержанность и легкость.",img:"item-53.jpg",catalogLink:"item-53",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-53.jpg"}},{title:"Крупногабаритный шкаф для хранения в гаражном помещении",materials:"<strong>Материалы и отделка:</strong> ЛДСП Egger.",description:"Большой шкаф для хранения в гаражном помещении. Фото не передает реальных размеров изделия. Наше производство позволяет выполнять заказы любых размеров и любой сложности.",img:"item-54.jpg",catalogLink:"item-54",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-54.jpg"}},{title:"Панель под ТВ в гостиной из шпона натурального ореха",materials:"<strong>Материалы и отделка:</strong> шпон ореха, венге, латунь.",description:"Панель под ТВ в гостиной из шпона натурального ореха с ручным подбором  уникального рисунка. Декоративные вставки из венге и латуни придают изделию особый шик и эстетику.",img:"item-55.jpg",catalogLink:"item-55",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-55.jpg",img2:"item-slide-55-1.jpg",img3:"item-slide-55-2.jpg"}},{title:"Шкаф для детской в эко-стиле из шпона ореха со встроенной подсветкой",materials:"<strong>Материалы и отделка:</strong> шпон ореха, мдф, эмаль.",description:" Шкаф с подсветкой для интерьера в экостиле– продуманное хранение в детской, которое спасет от беспорядка. Мебель в оттенках дерева излучает теплую энергию натуральных материалов, которая помогает стабилизировать эмоциональное состояние и влияет на настроение.",img:"item-56.jpg",catalogLink:"item-56",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-56.jpg"}},{title:"Встроенный шкаф из ореха со вставками из шпона венге и латуни",materials:"<strong>Материалы и отделка:</strong> шпон ореха, шпон венге, латунь.",description:"Трендсеттеры мира дизайна вспомнили пословицу «Не все то золото, что блестит» и ввели в моду другие желтые оттенки металла – медь и латунь. Сочетая дерево с латунью, можно получить роскошную мебель в винтажном или современном стиле.<br/><br/>Наша эксклюзивная мебель для прихожей из ореха со вставками из венге и латуни уже с порога способна произвести впечатление на Ваших гостей. Встроенный шкаф в гостевой комнате выполнен в похожем стиле, но уже без блеска металла, смотрится очень аккуратно, на загромождает пространство. Если Ваш интерьер имеет пространственные особенности, которые диктуют необходимость проектировать изделия из дерева на заказ, обращайтесь в Royal Wood. Мы поможем создать целостный деревянный интерьер, состоящий только из авторских изделий.",img:"item-57.jpg",catalogLink:"item-57",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-57.jpg",img2:"item-slide-57-1.jpg"}},{title:"Распашные шкафы для прихожей из белой эмали и шпона ореха",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, шпон ореха.",description:"Вместительные шкафы для зоны прихожей. Отсутствие декоративных элементов обеспечивает лаконичный дизайн и характеризует владельцев как уверенных людей, ценящих легкость и сдержанность в интерьере. Но все же простота эта роскошна за счет сочетания белой эмали и  натурального шпона американского ореха.  Оригинальные ручки, украшающие фасады, тоже столярного изготовления, выполнены из массива ореха.",img:"item-58.jpg",catalogLink:"item-58",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-58.jpg",img2:"item-slide-58-1.jpg",img3:"item-slide-58-2.jpg"}},{title:"Домашняя библиотека в интерьере премиум-класса из шпона американского ореха",materials:"<strong>Материалы и отделка:</strong> мдф, шпон американского ореха.",description:"Стильный интерьер премиум-класса из американского ореха дополнила домашняя библиотека в гостиной, создавая ауру гостеприимства, комфорта и престижа. От такой благородной красоты невозможно отвести глаз. Безупречное качество изделий и профессиональный монтаж обеспечили фантастический результат в этом проекте. Хотелось бы поблагодарить заказчиков за доверие и возможность испытывать гордость за свою работу.",img:"item-59.jpg",catalogLink:"item-59",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-59.jpg",img2:"item-slide-59-1.jpg"}},{title:"Строгий шкаф с зеркальными фасадами и вставками из патинированной латуни",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, зеркала, патинированная латунь.",description:"Еще один шкаф для интерьера премиум класса из американского ореха. На этот раз, чтобы гармонично подчеркнуть рисунок дерева, используемый очень активно в этом проекте, было решено изготовить графичный строгий шкаф с зеркальными фасадами и темными вставками из патинированной латуни. Насытив пространство теплом деревянных фактур, мы вдруг встречаем зеркальный арт обьект, ставший стильным и ярким акцентом в концепции данного интерьера.",img:"item-60.jpg",catalogLink:"item-60",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-60.jpg"}},{title:"Открытая система хранения для современного интерьера",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Хранение книг в современном интерьере.  Заказчик – предприниматель, устраивающий дома встречи с единомышленниками, мозговые штурмы и стратегические сессии, особое внимание уделял личной библиотеке. В общем доступе должно было быть место, знакомящее гостей с любимыми книгами, жизненными принципами и идеалами хозяина. Так в гостиной по проекту дизайнера появился необычный стеллаж индивидуального изготовления. Глубина стеллажа небольшая – всего 15 см – сделана для того, чтобы книжки ставить не корешками, а обложкой и названием к зрителю. Ячейки разного формата - для книг разного размера. Дно каждой полочки сделано «гребенкой», чтобы книжки стояли наклонно и не падали (продумывали индивидуально, с тестами в процессе проектирования). Позднее на стеллаже появились цветные светильники, колонка Алиса и Apple TV. Осталось наполнить книгами!",img:"item-61.jpg",catalogLink:"item-61",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-61.jpg",img2:"item-slide-61-1.jpg",img3:"item-slide-61-2.jpg",img4:"item-slide-61-3.jpg",img5:"item-slide-61-4.jpg",img6:"item-slide-61-5.jpg",img7:"item-slide-61-6.jpg"}},{title:"Минималистичная и функциональная система хранения для современного интерьера",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Очень интересный проект квартиры для молодого предпринимателя, продуманный до мелочей, просчитанный до сантиметров. Основной задачей было превращение квартиры в умную жилую капсулу при помощи современных технологий и инженерных решений. Здесь нет случайных вещей, каждый предмет несет свою функцию. Получился брутальный мужской интерьер с лофтовыми элементами. Почти треть квартиры занимает домашний офис, здесь хозяин проводит больше всего времени, работает, отдыхает, занимается спортом. Мебель соответсвующая, минималистичная, стильная и функциональная.",img:"item-62.jpg",catalogLink:"item-62",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-62.jpg",img2:"item-slide-62-1.jpg"}},{title:"Скрытый шкаф для прихожей из МДФ",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Скрытый шкаф для прихожей в проекте квартиры для молодого предпринимателя, продуманном до мелочей, просчитанном до сантиметров. Основной задачей было превращение квартиры в умную жилую капсулу при помощи современных технологий и инженерных решений. Здесь нет случайных вещей, каждый предмет несет свою функцию. Заказная мебель прекрасна тем, что весь ее функционал можно обустроить под ваш образ жизни, продумав  сценарий использования до мельчайших деталей. Например, высота обувных полок – четко под размер имеющейся обуви, в секции для хранения пылесоса расположение полок расчитывали под габариты существующей техники, там же внутри розетки для зарядки.",img:"item-63.jpg",catalogLink:"item-63",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-63.jpg",img2:"item-slide-63-1.jpg"}},{title:"Шкаф для спальни в загородном коттедже",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль",description:"Шкаф для уютной спальни в загородном коттедже. Он привносит в помещение спокойствие, поддерживая непринужденную атмосферу. Цветовое решение красиво перекликается с состаренными зеркалами на фасадах.",img:"item-64.jpg",catalogLink:"item-64",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-64.jpg"}},{title:"Шкаф для детской комнаты, покрытый белой матовой эмалью",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Шкаф для одежды, игрушек и мелочей в комнате ребенка с распашными секциями и ящиками. Нейтральный дизайн позволит оставаться актуальным на протяжении долгого времени, пока ребенок растет. Цвет, материал  и наполнение разрабатывается индивидуально под конкретный проект, поэтому эти параметры можно выбрать на свое усмотрение.",img:"item-65.jpg",catalogLink:"item-65",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-65.jpg",img2:"item-slide-65-1.jpg"}},{title:"Раздвижной шкаф для спальни в загородном доме",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Шкаф с раздвижными дверцами для уютной спальни в загородном доме. Он привносит в помещение спокойствие, поддерживая непринужденную атмосферу, поддерживая при этом яркие цветовые акценты пространства в эко стиле. Цвет, материал  и наполнение разрабатывается индивидуально под конкретный проект, поэтому эти параметры можно выбрать на свое усмотрение.",img:"item-66.jpg",catalogLink:"item-66",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-66.jpg",img2:"item-slide-66-1.jpg"}},{title:"Шкаф-буфет для обеденной зоны в стиле арт-деко",materials:"<strong>Материалы и отделка:</strong> мдф, шпон палисандра, серебряная поталь.",description:"Шкаф-буфет в современной интерпретации для обеденной зоны в стиле арт деко. Выполнен из экзотического шпона палисандра с набранным геометричным рисунком, в обрамлении рифленым молдингом , покрытым серебряной поталью. При помощи такого молдинга можно изменить внешний вид любой мебели. Такая, казалось бы, незначительная арихитектурная деталь может подчеркнуть основной стиль, создает логическое завершение мебели.",img:"item-67.jpg",catalogLink:"item-67",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-67.jpg"}},{title:"Встоенный в нишу шкаф для элитного интерьера из американского ореха",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, шпон ореха, патинированная латунь.",description:"Серия шкафов для элитного интерьера из американского ореха. Шкаф для хранения одежды разместился в небольшой нише. Чтобы увеличить его полезное пространство, он был спроектирован под потолок. В соседнем помещении была изготовлена целая конструкция  - скрытые двери с отделкой выразительным шпоном в обрамлении светлых шкафов визуально образуют единое целое. Находясь в одной плоскости, двери и фасады имеют общий декоративный элемент -   горизонтальную вставку из патинированной латуни. Безупречное качество изделий и профессиональный монтаж обеспечивают фантастический результат. Владельцы остались довольны гармонией и эстетикой своего нового дома.",img:"item-68.jpg",catalogLink:"item-68",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-68.jpg",img2:"item-slide-68-1.jpg"}},{title:"Стильный дизайнерский шкаф-купе с фасадами из экзотической редкой породы дерева сатиновый орех",materials:"<strong>Материалы и отделка:</strong> МДФ, шпон сатинового ореха, тонированное зеркало, тонировка, шелковисто-матовый лак.",description:"Стильный дизайнерский шкаф-купе с фасадами из экзотической редкой породы дерева сатиновый орех. Шкаф обрамлен декоративным багетом, покрытым серебряной поталью. Тонированное большое зеркало в раме украшает центральную часть фасада шкафа – очень правильное и рациональное решение.",img:"item-69.jpg",catalogLink:"item-69",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-69.jpg"}},{title:"Шкаф с белым глянцевым покрытием для прихожей",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, глянцевый лак.",description:"Шкаф с белым глянцевым покрытием эффектно украшает холл в прихожей, наполняя его светом и легкостью, подчеркивая безупречный вкус хозяев. Современный стиль обьединяет легкую элегантность и простую прагматичность. Главное – тщательно продумать детали. Обращайтесь, и мы расскажем с чего начать!",img:"item-70.jpg",catalogLink:"item-70",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-70.jpg",img2:"item-slide-70-1.jpg",img3:"item-slide-70-2.jpg"}},{title:"Дизайнерский стеллаж для книг со стеклянными дверцами и подсветкой ",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, стекло.",description:"Дизайнерский стеллаж для книг со стеклянными дверцами и подсветкой – удобный и практичный предмет мебели, ставший акцентом внимания в интерьере. Дерево и комбинация прозрачного стекла с матовым обеспечивают уникальный и неповторимый вид в стиле хай-тек.",img:"item-71.jpg",catalogLink:"item-71",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-71.jpg"}},{title:"Встроенный шкаф хозяйственного назначения из МДФ",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль.",description:"Аккуратный шкафчик для хозяйственных принадлежностей идеально вписался в имеющуюся нишу. Белый цвет самый популярный и выигрышный, он создает ощущение чистоты и порядка в доме. Цвет, материал  и наполнение разрабатывается индивидуально под конкретный проект, поэтому эти параметры можно выбрать на свое усмотрение.",img:"item-72.jpg",catalogLink:"item-72",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-72.jpg"}},{title:"Распашной встроенный шкаф с врезными деревянными ручками в стиле минимализм",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль., ручки из массива дуба.",description:"Наша мебель премиум класса подразумевает , что все изделия изготавливаются только на заказ, конкретно под Ваши индивидуальные размеры и запросы. Распашной встроенный шкаф с врезными деревянными ручками в стиле минимализм  это символ умеренности и лаконичности, и выражает самодостаточность своего владельца. Непринужденный, нейтральный оттенок создает прекрасный союз с симметричностью и пропорциональностью форм.",img:"item-73.jpg",catalogLink:"item-73",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-73.jpg"}},{title:"Скрытый встроенный шкаф с деревянными ручками из массива дуба",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, массив дуба.",description:"Скрытый встроенный шкаф с деревянными ручками из массива дуба, маскирующий межкомнатную дверь, демонстрирурет правильную организацию хранения вещей в условиях ограниченной площади. При грамотной планировке наполнения такой шкаф способен заменить полноценную гардеробную комнату. Пастельные тона в сочетании с натуральным деревом  идеальное решения для спальни, настраивает на спокойствие и расслабление.",img:"item-74.jpg",catalogLink:"item-74",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-74.jpg"}},{title:"Книжный шкаф с дверцами из матового стекла и подсветкой",materials:"<strong>Материалы и отделка:</strong> мдф, эмаль, матовое стекло.",description:"Как это прекрасно , что наши заказчики, читающие люди. Каких только книжных шкафов и домашних библиотек мы не проектировали! Вот еще один пример небольшого книжного шкафа. Встроенная подсветка, рассеиваясь через матовое стекло, создает  дополнительное приятное освещение в холле.",img:"item-75.jpg",catalogLink:"item-75",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-75.jpg"}},{title:"Шкаф для гостиной по индивидуальному проекту",materials:"<strong><strong>Материалы и отделка:</strong></strong> фасады - мдф, эмаль, корпус – шпон дуба.",description:"Масштабный вместительный шкаф во всю стену в лаконичном дизайне с подсветкой изготовлен специально по проекту архитекторов. Такой яркий обьект мебели сам по себе является частью отделки интерьера, играет ключевую роль  в гостиной. Здесь учтены и место для ТВ, и встроенный камин, и открытые полки для дополнительного декора, и закрытые секции для хранения.",img:"item-slide-76-2.jpg",catalogLink:"item-76",catalogPathImg:"/catalog/wardrobes/modern/",catalogPathCategory:"/catalog/wardrobes/",catalogImgs:{img1:"item-slide-76-2.jpg",img2:"item-slide-76-1.jpg",img3:"item-76.jpg",img4:"item-slide-76-3.jpg",img5:"item-slide-76-4.jpg"}}];return(k,C)=>(i(),g("section",j,[b,t("div",h,[(i(),g(o,null,e(s,a=>m(r,{key:a.title,"category-data":a},null,8,["category-data"])),64))]),P,t("div",w,[(i(),g(o,null,e(c,a=>m(l,{key:a.title,"catalog-data":a},null,8,["catalog-data"])),64))])]))}});export{E as default};
